const Image = () => {
  return (
    <img
      style={{ display: "flex", width: "100%", objectFit: "contain" }}
      src="https://media.wired.com/photos/593261cab8eb31692072f129/master/pass/85120553.jpg"
      alt="cutest animal"
    />
  );
};

export default Image;
